import React from 'react';
import image from './image.png';
import './Message.css';

const Message = ({ userName }) => {
    const redirectToUrl = (url) => {
        window.location.href = url;
    };

    return (
        <div className="containerm">
            <div className="message-container">
                <img src="data:image/png;base64," alt="message" />
                <h3 style={{ fontSize: "42px", fontWeight: "700" }}>Congratulations {userName}</h3>
                <p className='p_message'>
                    Your inputs are well received, and your video introduction is under
                    preparation. It may take a few minutes. We will notify and email you
                    when it is ready.
                </p>
                <div className='box-con'></div>
                <div className="button-container">
                    <button className="action-button" onClick={() => redirectToUrl('https://mynextfilm.ai/ReferYouFriend')}>
                        Refer your Friends
                    </button>
                    <button className="action-button" onClick={() => redirectToUrl('https://mynextfilm.ai/pay/payment/')}>
                        Become Privileged Member
                    </button>
                    <button className="action-button" onClick={() => redirectToUrl('https://mynextfilm.ai/memberpage/#/')}>
                        Visit Profile
                    </button>
                    <button className="action-button" onClick={() => redirectToUrl('https://mynextfilm.ai/memberpage/#/findfriend')}>
                        Find Buddies
                    </button>
                    <button className="action-button" onClick={() => redirectToUrl('https://mynextfilm.ai/harkat/propose')}>
                        Join Harkat club
                    </button>
                    <button className="action-button" onClick={() => redirectToUrl('https://mynextfilm.ai/rm/registration/')}>
                        Become Messiah
                    </button>
                    <button className="action-button" onClick={() => redirectToUrl('https://mynextfilm.ai/lpp/lppregistration/')}>
                        Apply for Language Pair Partner
                    </button>
                </div>
            </div>
        </div>
    );
};

export default Message;
